import React from 'react';
import './App.css'


const App = () => {
  return (
    <div className='atvk'>
      <header className='Header'>
        <img src='https://upload.wikimedia.org/wikipedia/commons/5/52/Free_logo.svg'></img>
      </header>
      <nav className='Nav'>

        <div>Profile</div>
        <div>Massage</div>
      </nav>

      <div className='Content'>
        Main content
      </div>

    </div>
  );
}

export default App;
